class Solution:
    # 滑动窗口 k1, k2
    def longestOnes(self, A, K: int) -> int:
        if K == 0:
            return self.K0(A)

        maxx = 0

        k1 = self.next(A, -1)
        if k1 == -1:
            return len(A)

        k2 = k1
        while K > 1:
            k2 = self.next(A, k2)
            maxx = max(maxx, self.getLen(A, k1, k2))
            K -= 1
        if k2 == -1:
            return len(A)

        # k1,k2
        while True:
            maxx = max(maxx, self.getLen(A, k1, k2))
            k1 = self.next(A, k1)
            k2 = self.next(A, k2)
            if k2 == -1:
                maxx = max(maxx, self.getLen(A, k1, len(A) - 1))
                return maxx

    def next(self, A, i: int):
        le = len(A)
        i += 1
        while i < le:
            if A[i] == 0:
                return i
            i += 1
        return -1

    def getLen(self, A, k1, k2):
        k1 -= 1
        while k1 >= 0:
            if A[k1] == 0:
                break
            k1 -= 1
        k1 += 1

        k2 += 1
        while k2 < len(A):
            if A[k2] == 0:
                break
            k2 += 1
        k2 -= 1

        return k2 - k1 + 1

    def K0(self, A):
        maxx = 0
        tmp = 0
        for a in A:
            if a == 0:
                maxx = max(maxx, tmp)
                tmp = 0
            else:
                tmp += 1
        return maxx


